const common = { black: '#000', white: '#fff' };

const background = { paper: '#fff', default: '#fafafa' };

const primary = {
  light: 'rgba(35, 151, 243, 1)',
  main: 'rgba(13, 72, 161, 0.87)',
  dark: 'rgba(13, 72, 161, 1)',
  contrastText: '#fff'
};

const secondary = {
  light: 'rgba(255, 202, 40, 1)',
  main: 'rgba(255, 193, 7, 1)',
  dark: 'rgba(255, 179, 0, 1)',
  contrastText: '#fff'
};

const error = {
  light: '#e57373',
  main: '#f44336',
  dark: '#d32f2f',
  contrastText: '#fff'
};

const text = {
  primary: 'rgba(0, 0, 0, 0.87)',
  secondary: 'rgba(0, 0, 0, 0.54)',
  disabled: 'rgba(0, 0, 0, 0.38)',
  hint: 'rgba(0, 0, 0, 0.38)'
};

export { common, background, primary, secondary, error, text };
